import React, { Component } from 'react'

class userPrivacy extends Component {

  //Function continue to move to the next tab
  continue = e => {
    e.preventDefault();
    this.props.nextStep();
  }

  //Function to come back one step
  back = e => {
    e.preventDefault();
    this.props.prevStep();
  }

  render() {
    return (
      <div>
        <h1>User Privacy</h1>
      </div>
    )

  }
}

export default userPrivacy
